-- ----------------------------
-- Table structure for tinywan_order
-- ----------------------------
DROP TABLE IF EXISTS `tinywan_order`;
CREATE TABLE `tinywan_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '#',
  `mch_id` int(11) DEFAULT NULL COMMENT '商户id',
  `order_no` varchar(255) DEFAULT NULL COMMENT '订单号',
  `mch_order_no` varchar(255) DEFAULT NULL COMMENT '商户订单号',
  `channel_order_no` varchar(255) DEFAULT NULL COMMENT '渠道订单号',
  `goods` varchar(255) DEFAULT NULL COMMENT '商品名',
  `price` decimal(13,2) DEFAULT '0.00' COMMENT '原价',
  `total_fee` decimal(13,2) DEFAULT '0.00' COMMENT '实付金额',
  `channel` char(32) DEFAULT NULL COMMENT '渠道',
  `payment` char(32) DEFAULT NULL COMMENT '支付方式',
  `channel_merchant_no` varchar(255) DEFAULT NULL COMMENT '渠道商户号',
  `jiesuan_status` tinyint(2) DEFAULT '0' COMMENT '结算状态（环讯）0 未结算  1已结算 2 结算失败',
  `cost_rate` decimal(13,4) DEFAULT '0.0000' COMMENT '成本费率',
  `rate` decimal(13,4) DEFAULT '0.0000' COMMENT '费率',
  `type` tinyint(1) DEFAULT '1' COMMENT '订单类型  1正常订单   2转账模式支付订单',
  `pay_type` tinyint(1) DEFAULT '1' COMMENT '支付方式（1支付宝  2微信）转账模式参数',
  `mch_user_id` varchar(64) DEFAULT '' COMMENT '商户用户id',
  `account` varchar(64) DEFAULT '' COMMENT '收款账号（转账模式用）',
  `qrcode` varchar(255) DEFAULT '' COMMENT '二维码链接(转账模式用)',
  `service_charge` decimal(13,3) DEFAULT '0.000' COMMENT '手续费',
  `pay_url` text COMMENT '支付链接',
  `notify_url` varchar(255) DEFAULT NULL COMMENT '异步通知地址',
  `return_url` varchar(255) DEFAULT NULL COMMENT '同步通知地址',
  `status` tinyint(2) DEFAULT '0' COMMENT '支付状态 -1支付失败  0未支付  1已支付  2已退款',
  `notify_status` enum('no','fail','yes') DEFAULT 'no' COMMENT '异步通知状态',
  `notify_count` int(11) DEFAULT '0' COMMENT '通知次数',
  `last_notify_time` int(11) DEFAULT '0' COMMENT '最后通知时间',
  `create_time` int(11) DEFAULT NULL COMMENT '创建时间',
  `pay_time` int(11) DEFAULT NULL COMMENT '支付时间',
  `refund_time` int(11) DEFAULT NULL COMMENT '退款时间',
  `channel_return_data` text COMMENT '渠道请求结果数据(json_encode）',
  `expire_time` int(11) DEFAULT '0' COMMENT '订单过期时间（目前只有转账模式用）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=296 DEFAULT CHARSET=utf8mb4 COMMENT='支付订单';

-- ----------------------------
-- Records of tinywan_order
-- ----------------------------
SET FOREIGN_KEY_CHECKS=1;
